r is on Register page and validate the fields \"usename\",\"password\",and \"password confirmation\" with valid/invalid data\n\n@hello\nScenario Outline: User click on register button with username and password fields empty\nGiven New user is on Register page\nWhen User enters username \"<Sheetname>\" and password <RowNumber> both as blank\nAnd User click on register button\nThen User should get error message for blank field\n\n\n Examples: \n      | Sheetname      |  RowNumber|\n      | Sheet1         |         0 |\n      \n \n@hello\nScenario Outline: User click on register button with user name but empty password\nGiven New user is on Register page\nWhen User enter username \"<Sheetname>\" and password <RowNumber> as blank\nAnd  User click on register button\nThen User should get error message for blank field\n\nExamples: \n      | Sheetname      |  RowNumber|\n      | Sheet1         |         1 |\n      \n\n@hello \nScenario Outline: User click on register button with user name and password and confirm password as blank\nGiven New user is on Register page\nWhen  User enter username \"<Sheetname>\" and password <RowNumber> but confirm password as blank\nAnd   User click on register button\nThen  User should get error message for blank field\n\nExamples: \n      | Sheetname      |  RowNumber|\n      | Sheet1         |         2 |\n      \n\n@8chars\nScenario Outline: User enter username and password less than 8 chars\nGiven New user is on Register page\nWhen  User enter username \"<Sheetname>\" and password <RowNumber> less than 8 chars\nAnd   User click on register button\nThen  User should get mismatch error message\n\nExamples: \n      | Sheetname      |  RowNumber|\n      | Sheet1         |         3 |\n      \n\n\n@mismatch\nScenario Outline: User click on register button with password with only numeric value\nGiven New user is on Register page\nWhen User enter username \"<Sheetname>\" and password <RowNumber> with numeric value only\nAnd User click on register button\nThen User should get mismatch error message\n\nExamples: \n      | Sheetname      |  RowNumber|\n      | Sheet1         |         4 |\n \n\n@haha\nScenario Outline: User click on register button with user name as blank and password and confirm password with valid values\nGiven New user is on Register page\nWhen  User enter username \"<Sheetname>\" as blank and password <RowNumber> with valid value\nAnd   User click on register button\nThen  User should get error message for blank field\n\nExamples: \n      | Sheetname      |  RowNumber|\n      | Sheet1         |         5 | \n      \n\n@mismatch\nScenario Outline: User click on register button with user name and different password and confirm password\nGiven New user is on Register page\nWhen User enter username \"<Sheetname>\" and different password <RowNumber> and confirm password\nAnd User click on register button\nThen User should get mismatch error message\n\nExamples: \n      | Sheetname      |  RowNumber|\n      | Sheet1         |         6 | \n      \n      \n@teacher\nScenario Outline: User click on register button with valid user name and password and confirm password\nGiven New user is on Register page\nWhen User enter valid username \"<Sheetname>\" and password <RowNumber> and confirm password\nAnd User click on register button\nThen User should be logged in successfully\n\nExamples: \n      | Sheetname      |  RowNumber|\n      | Sheet1         |         7 | ","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/praveenkumarsharma/eclipse-workspace/justdsalgo/src/test/resources/features/register.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@tag","id":"50522ecb-0770-45f3-88df-506cc3a4b54e"}],"language":"en","keyword":"Feature","name":"User is on Register page and validate the fields \"usename\",\"password\",and \"password confirmation\" with valid/invalid data","description":"","children":[{"scenario":{ gin button \n\tWhen User click Get Started button for the stack card \n\tThen User should redirected to stack page \n\tWhen User click operations in stack link\n\tAnd  User click Try Here button\n\tThen User should be redirected to try Text Editor page\n\tWhen User enter python code \"<Sheetname>\" in tryEditor <RowNumber> and click run button \n\tThen User should see code executed successfully \n \n\tExamples: \n\t\t| Sheetname | RowNumber |\n\t\t| Sheet1    |         4 |\n  \n\n @stack \n Scenario Outline: User navigate to Stack list data structure page and validate implementation in stack page\n \tGiven The user is on signin page\n \tWhen The user enter sheet \"<Sheetname>\" and <RowNumber> \n  And  click login button \n\tWhen User click Get Started button for the stack card \n\tThen User should redirected to stack page \n\tWhen User click implementation link on stack page\n\tAnd  User click Try Here button\n\tThen User should be redirected to try Text Editor page\n\tWhen User enter python code \"<Sheetname>\" in tryEditor <RowNumber> and click run button \n\tThen User should see code executed successfully \n \n\tExamples: \n\t\t| Sheetname | RowNumber |\n\t\t| Sheet1    |         4 |\n\t\t\n\n@stack \n Scenario Outline: User navigate to Stack list data structure page and validate applications in stack page\n \tGiven The user is on signin page\n \tWhen The user enter sheet \"<Sheetname>\" and <RowNumber> \n  And  click login button \n\tWhen User click Get Started button for the stack card \n\tThen User should redirected to stack page \n\tWhen User click applications link on stack page\n\tAnd  User click Try Here button\n\tThen User should be redirected to try Text Editor page\n\tWhen User enter python code \"<Sheetname>\" in tryEditor <RowNumber> and click run button \n\tThen User should see code executed successfully \n \n\tExamples: \n\t\t| Sheetname | RowNumber |\n\t\t| Sheet1    |         4 |\n  \n\n@stack  \nScenario Outline: User navigate to stack data structure page and validates practice questions page\n    Given The user is on signin page\n    When The user enter sheet \"<Sheetname>\" and <RowNumber> \n\t\tAnd  click login button \n\t\tWhen User click Get Started button for the stack card \n\t\tThen User should redirected to stack page\n\t\tWhen User click implementation link on stack page \n\t\tThen User click practice questions link on implementation page\n\t\tThen User validates the stack title\n \n\tExamples: \n\t\t| Sheetname | RowNumber |\n\t\t| Sheet1    |         4 |\n  \n  \n@stackinvalid \nScenario Outline: User navigate to Stack list data structure page and validate operations in stack page for invalid code\n    Given The user is on signin page\n    When The user enter sheet \"<Sheetname>\" and <RowNumber> \n\t\tAnd  click login button \n\t\tWhen User click Get Started button for the stack card \n\t\tThen User should redirected to stack page\n\t\tWhen User click operations in stack link \n\t\tAnd  User click Try Here button\n\t\tThen User should be redirected to try Text Editor page\n\t\tWhen User enter invalid python code \"<Sheetname>\" in tryEditor <RowNumber> and click run button \n\t\tThen User should get error message alert window\n \n\tExamples: \n\t\t| Sheetname | RowNumber |\n\t\t| Sheet1    |         3 |\n\t\t\n\n@stackinvalid \nScenario Outline: User navigate to Stack list data structure page and validate implementation in stack page for invalid code\n    Given The user is on signin page\n    When The user enter sheet \"<Sheetname>\" and <RowNumber> \n\t\tAnd  click login button \n\t\tWhen User click Get Started button for the stack card \n\t\tThen User should redirected to stack page\n\t\tWhen User click implementation link on stack page\n\t\tAnd  User click Try Here button\n\t\tThen User should be redirected to try Text Editor page\n\t\tWhen User enter invalid python code \"<Sheetname>\" in tryEditor <RowNumber> and click run button \n\t\tThen User should get error message alert window\n \n\
